import React from 'react';
import { Link } from 'react-router-dom';
class Header extends React.Component {
	render() {
		return (
			<nav className='navbar bg-success'>
				<Link to='/' className='navbar-brand' style={{ color: 'white' }}>
					Twitch
				</Link>
			</nav>
		);
	}
}
export default Header;
